import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const handleWorkoutsClick = () => {
    navigate('/workouts');
  };

  const handleExercisesClick = () => {
    navigate('/exercises');
  };

  return (
    <div>
      <h1>Welcome to Flex Fitness</h1>
      <p>Get fit and stay healthy with our workout and exercise tracking app.</p>
      <button onClick={handleWorkoutsClick}>View Workouts</button>
      <button onClick={handleExercisesClick}>View Exercises</button>
    </div>
  );
};

export default Home;
